import Header from '../components/Header'
import 'react-calendar/dist/Calendar.css';

function Kitchen() {
    document.getElementById("kitchenButton").style.display = "none";
}

export default function Tasks() {
    return (
        <div>
            <Header />
            <h2>What type of task would you like to add to the to-do list?</h2>
            <button id="kitchenButton" onClick={Kitchen}>Kitchen</button>
            <input>Input</input>
        </div>
    )
}
